INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (37, 118501, 0, 2.0, 118501, 118501, 0, 1, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 1, "かりん", "2021/10/19 12:00:00", 0, 0, "カリン", 787, 0, "2030/12/31 15:00:00", 37, 118501, 0, 2, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 118601, 0, 2.0, 118601, 118601, 0, 3, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 1, "ねびあ", "2024/08/10 21:00:00", 0, 0, "ネビア", 826, 0, "2030/12/31 15:00:00", 0, 118601, 0, 2, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (7, 119001, 0, 2.27, 119001, 119001, 0, 3, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, "いお", "2021/11/03 19:00:00", 0, 0, "イオ（ノワール）", 714, 0, "2030/12/31 15:00:00", 7, 119001, 0, 2, 15, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (26, 119101, 0, 2.545, 119101, 119101, 0, 3, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, "くうか", "2021/11/16 12:00:00", 0, 0, "クウカ（ノワール）", 143, 0, "2030/12/31 15:00:00", 7, 119101, 0, 2, 12, 450, 0);
