INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (38, 128301, 0, 2.09, 128301, 128301, 0, 1, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 1, "いのり", "2026/01/16 15:00:00", 0, 0, "イノリ（ニューイヤー）", 191, 0, "2030/12/31 15:00:00", 3, 128301, 0, 1, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (21, 128401, 0, 2.09, 128401, 128401, 0, 3, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 1, "はつね", "2026/01/15 12:00:00", 0, 0, "ハツネ（ニューイヤー）", 801, 0, "2026/01/31 11:59:59", 7, 128401, 0, 2, 0, 450, 0);
