INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 128701, 0, 2.09, 128701, 128701, 0, 3, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, "ひより", "2026/01/31 12:00:00", 0, 0, "ヒヨリ（アストラル）", 226, 0, "2026/02/09 11:59:59", 1, 128701, 0, 1, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 128801, 0, 1.965, 128801, 128801, 0, 1, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 1, "れい", "2025/08/16 15:00:00", 0, 0, "レイ（アストラル）", 194, 0, "2030/12/31 15:00:00", 4, 128801, 0, 1, 0, 450, 0);
