INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (7, 129301, 0, 2.09, 129301, 129301, 0, 3, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 1, "ゆに", "2025/03/10 12:00:00", 0, 0, "ユニ（ウィンター）", 708, 0, "2025/03/15 14:59:59", 7, 129301, 0, 1, 0, 450, 0);
