INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (1, 129501, 0, 2.09, 129501, 129501, 0, 3, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, "ちえる", "2025/11/30 12:00:00", 0, 0, "チエル（ウィンター）", 247, 0, "2025/12/15 14:59:59", 1, 129501, 0, 1, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 129601, 0, 2.09, 129601, 129601, 0, 3, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 1, "あねもね", "2025/12/31 12:00:00", 0, 0, "アネモネ", 550, 0, "2026/01/03 11:59:59", 0, 129601, 0, 1, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 129701, 0, 2.09, 129701, 129701, 0, 3, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 1, "ねふぃーねら", "2025/12/31 12:00:00", 0, 0, "ネフィ＝ネラ", 540, 0, "2026/01/03 11:59:59", 0, 129701, 0, 1, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (5, 129801, 0, 2.09, 129801, 129801, 0, 3, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 1, "まこと", "2025/04/26 12:00:00", 0, 0, "マコト（コマンダー）", 269, 0, "2025/04/30 11:59:59", 5, 129801, 0, 1, 0, 450, 0);
