INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (8, 137901, 0, 2.09, 137901, 137901, 0, 3, "【魔法】後衛で絵馬に込めた想いを胸に抱く晴れ着の妹。\nクリティカル時に威力が上がる矢で敵を撃ち抜き、味方\n全体への攻撃支援や継続ＴＰ回復で厄を払い福を届ける。", 1, "りの", "2026/01/15 12:00:00", 0, 0, "リノ（ニューイヤー）", 684, 0, "2026/01/31 11:59:59", 8, 137901, 0, 2, 0, 450, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 138001, 0, 2.09, 138001, 138001, 0, 3, "【物理】前衛から慈愛の心で冥府を包む彼岸の屍姫。\nＵＢは敵全体を呑み込む割合ダメージを与え、【冥海の加\n護】を消費して味方の攻防ダウン効果までも禊ぎ清める。", 1, "うぁいおれっと", "2026/01/31 12:00:00", 0, 0, "ヴァイオレット（イサナミ）", 154, 0, "2026/02/09 11:59:59", 0, 138001, 0, 1, 0, 450, 0);
