INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 138201, 0, 2.09, 138201, 138201, 0, 3, "【物理】中衛から怯懦を退け、万魔を率する煉獄の鉄媛。\n千変万化の躰は行動速度アップを始めとする多彩な支援と\nすべての敵の弱体を両立し、天地万象を掌の内に収める。", 1, "ねふぃーねら", "2026/02/15 12:00:00", 0, 0, "ネフィ＝ネラ（鬼面仏心）", 502, 0, "2026/02/28 11:59:59", 0, 138201, 0, 1, 0, 450, 0);
